import './editDay.css'

export default function EditDay(props) {
    return (props.trigger) ? (
        <div className="editDay">
            <div className="popup-inner">
                <button className="close-button" onClick={props.setTrigger}>[x]</button>
                <span className="date">{props.month} {props.day} {props.year}</span>
            </div>
        </div>
    ) : "";
}
